import React from 'react';
import logo from './logo.svg';
import './App.css';
import MissionRow from './MissionRow';
import ImperialTracker from './ImperialTracker';
import { unstable_renderSubtreeIntoContainer } from 'react-dom';

function App() {
  return (
    <div className="App">
      <MissionRow missionType="Introduction" threatLevel={2} itemTiers={[1]}/>
      <MissionRow missionType="Side Mission" threatLevel={3} itemTiers={[1, 2]}/>
      {/* <ImperialTracker 
          xp={1}
          influence={2}
          ongoingAgendas={[
                            {name: 'high bounty', target: 'biv bodhrik'}, 
                            {name: 'no escape', target: 'Garkan'}, 
                            {name: 'All Too Easy', target: 'Diala Pasil'}
                          ]}/> */}
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
